The Magic Numbers - The Pulse (2010)(EP)


The Magic Numbers are an English indie rock band comprising two pairs of brothers and sisters who all attended The Cardinal Wiseman Roman Catholic High School in Greenford. The group was formed in 2002, releasing their critically acclaimed debut album titled The Magic Numbers on 13 June 2005. Their follow-up album, Those the Brokes was released on 6 November 2006.

The Magic Numbers are: Romeo Stodart (lead guitar, vocals), Michele Stodart (bass, vocals), Sean Gannon (drums) and Angela Gannon (melodica, percussion, glockenspiel, vocals).




New EP from The Magic Numbers called &quot;The Pulse EP&quot;. This is a pre-release EP for their forthcoming album &quot;The Runaway&quot; that will out July 26th. Two songs from this EP will not be included in full album.




